func (e TL_inputMediaUploadedPhoto) encode() []byte {
	var flags int32
	if e.Spoiler {
		flags |= (1 << 2)
	}
	if e.Stickers != nil {
		flags |= (1 << 0)
	}
	if e.TTLSeconds != nil {
		flags |= (1 << 1)
	}
	x := NewEncodeBuf(512)
	x.UInt(CRC_inputMediaUploadedPhoto)
	x.Int(flags)
	x.Object(e.File)
	if e.Stickers != nil {
		EncodeBuf_GenericVector(x, e.Stickers)
	}
	if e.TTLSeconds != nil {
		x.Int(*e.TTLSeconds)
	}
	return x.buf
}

